import React, {Component} from 'react';
import Plot from 'react-plotly.js';
import { neighborhood, percent_overdue } from './data/overdue_percent.js'
import {neighborhood_for_time, neighborhood_mean } from './data/response_time.js'

class App extends React.Component {
  render() {
    return (
      <div>
      <div>
      <Plot
        data={[
  {
    x: neighborhood,
    y: percent_overdue,
    type: 'bar'
  }
]}
        layout={ {width: 600, height: 500, title: 'Overdue requests by neighborhood', yaxis:{
    title: 'Proportion of service requests overdue'} }}
      />,
       <h2>Reflections</h2>
      <ul>
<li>Less affluent neighbourhoods such as Hyde Park, East Boston, and Charlestown were among those where it took longest for 311 requests to be answered.
</li>
<li>Requests were answered most quickly in South Boston, which has gentrified rapidly over the past ten years.</li>
<li>Example 3</li>
</ul>,
    <Plot
        data={[
  {
    x: neighborhood_for_time,
    y: neighborhood_mean,
    type: 'bar'
  }
]}
        layout={ {width: 600, height: 500, title: 'Completion time by neighborhood', yaxis:{
    title: 'Days to close request, by neighborhood '}} }
      />,
      <h2>Reflections</h2>
      <ul>
<li>Less affluent neighbourhoods such as Hyde Park, East Boston, and Charlestown were among those where it took longest for 311 requests to be answered.
</li>
<li>Requests were answered most quickly in South Boston, which has gentrified rapidly over the past ten years.</li>
<li>Example 3</li>
</ul></div>

      <div>
</div>
</div>
    );
  }
}


export default App;
